create table party (
	party_id BIGSERIAL NOT NULL PRIMARY KEY,
	reference_number INT NOT NULL,
	party_type_id INT NOT NULL,
	name VARCHAR(50),
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	address_line1 VARCHAR(50),
	address_line2 VARCHAR(50),
	postal_code VARCHAR(50),
	town VARCHAR(50),
	county VARCHAR(50),
	country VARCHAR(50),
	phone_mobile VARCHAR(50),
	phone_landline VARCHAR(50),
	date_of_birth DATE,
	email VARCHAR(50),
	address_line3 VARCHAR(50),
	address_line4 VARCHAR(50),
	editor VARCHAR(50) NOT NULL,
	editor_source VARCHAR(50) NOT NULL
);

create table policy (
	policy_id BIGSERIAL NOT NULL PRIMARY KEY,
	party_id INT NOT NULL,
	policy_number INT NOT NULL,
	start_date DATE NOT NULL,
	expiration_date DATE NOT NULL,
	editor VARCHAR(50) NOT NULL,
	editor_source VARCHAR(50) NOT NULL,
	FOREIGN KEY(party_id) REFERENCES party(party_id)
);

create table policy_version (
	policy_version_id BIGSERIAL NOT NULL PRIMARY KEY,
	policy_version_number INT NOT NULL,
	start_date DATE NOT NULL,
	end_date DATE NOT NULL,
	issue_date DATE NOT NULL,
	policy_version_status_id INT NOT NULL,
	policy_id INT NOT NULL,
	interaction_id INT NOT NULL,
	editor VARCHAR(50) NOT NULL,
	editor_source VARCHAR(50) NOT NULL,
	FOREIGN KEY(policy_id) REFERENCES policy(policy_id)
);





